import React from "react";
import './Home.css';
const Home = () => {
  return (
    <>
    <div className="nav">
      <h1 className="homeHead"><span>F</span>-UPLO <span><i class="fa-solid fa-arrow-up-to-line"></i></span> D</h1>
    </div>
    <div className="mainPage">
    <img src="" alt=""/>
    <i class="fa-solid fa-arrow-up-to-line"></i>
    </div>
    </>
  );
};
export default Home;
